import { createRoot } from "react-dom/client";

const Card=()=>{
return(
       <div>
       <img alt='robots' src='https://robohash.org/test'></img>
       <div >
        <h2 className='justify'>john</h2>
        <p className='justify'>johnatmoon@gmail</p>
       </div>
       </div>
)
}

export default Card;
